() => {
  // Find the "In evidenza" section by its heading
  const evidenzaHeading = Array.from(document.querySelectorAll('h2')).find(h => h.textContent.includes('In evidenza'));
  if (!evidenzaHeading) return { error: 'Section not found' };

  // Get the parent container that holds the cards
  const section = evidenzaHeading.closest('div').querySelector('[role="list"]');
  if (!section) return { error: 'List container not found' };

  const cards = section.querySelectorAll('article');
  const results = [];

cards.forEach((card, index) => {
    const computedStyles = window.getComputedStyle(card);
    const parentStyles = window.getComputedStyle(card.parentElement);

    // Get all relevant text alignment properties
    const textAlign = computedStyles.textAlign;
    const direction = computedStyles.direction;
    const justifyContent = computedStyles.justifyContent;
    const alignItems = computedStyles.alignItems;

    // Check for any CSS classes that might affect alignment
    const classes = [...card.classList, ...card.parentElement.classList];

    results.push({
      cardIndex: index + 1,
      textAlign,
      direction,
      justifyContent,
      alignItems,
      classes: classes,
      parentTextAlign: parentStyles.textAlign,
      parentDirection: parentStyles.direction
    });
  });

  return {
    totalCards: cards.length,
    cards: results.slice(0, 3) // Just show first 3 for brevity
  };
}

() => {
  // Find the "In evidenza" section and get detailed CSS analysis
  const evidenzaHeading = Array.from(document.querySelectorAll('h2')).find(h => h.textContent.includes('In evidenza'));
  if (!evidenzaHeading) return { error: 'Section not found' };

  // Find the container with the cards
  const container = evidenzaHeading.parentElement;
  const listContainer = container.querySelector('ul, [role="list"]');

  if (!listContainer) return { error: 'List container not found' };

  const articles = listContainer.querySelectorAll('article');

  const results = [];

  articles.forEach((article, index) => {
    if (index < 3) { // Only check first 3 cards
      const styles = window.getComputedStyle(article);
      const parentStyles = window.getComputedStyle(article.parentElement);

      // Look for text content
      const textElements = article.querySelectorAll('h1, h2, h3, p, div');
      const textAlignments = [];

      textElements.forEach(el => {
        const elStyles = window.getComputedStyle(el);
        if (elStyles.textAlign && elStyles.textAlign !== 'start') {
          textAlignments.push({
            tag: el.tagName,
            textAlign: elStyles.textAlign,
            text: el.textContent.substring(0, 50) + '...'
          });
        }
      });

      results.push({
        cardIndex: index + 1,
        articleTextAlign: styles.textAlign,
        articleDirection: styles.direction,
        parentTextAlign: parentStyles.textAlign,
        parentDirection: parentStyles.direction,
        textElements: textAlignments,
        classes: [...article.classList]
      });
    }
  });

  return {
    success: true,
    cardAnalysis: results
  };
}
